import ExpenseItem from "./Components/ExpenseItem";

function App() {
  const expenses = [
    {
      id: "e1",
      title: "Car Insurance",
      amount: 300,
      date: new Date(2022, 2, 1),
    },
    {
      id: "e2",
      title: "home Insurance",
      amount: 200,
      date: new Date(2022, 1, 1),
    },
    {
      id: "e3",
      title: "Car Insurance",
      amount: 400,
      date: new Date(2022, 0, 13),
    },
  ];

  return (
    <div className="App">
      <ExpenseItem items={expenses} />
    </div>
  );
}

export default App;
